gint *
chafa_gen_noise_matrix (gdouble magnitude)
{
    gint *matrix;
    gint i;

    matrix = g_malloc (NOISE_TEXTURE_ARRAY_LEN * sizeof (gint));

    for (i = 0; i < NOISE_TEXTURE_ARRAY_LEN; i++)
    {
        matrix [i] = ((gdouble) blue_noise_src [i] - 128.0) * magnitude + 0.5;
    }

    return matrix;
}
